const labeldata = {
  xiaomi: Array.from({ length: 17 }, (_, i) => {
    const id = (i + 1).toString();
    return {
      _id: id,
      image: require(`../img/Xiaomi/${id}.jpg`),
      sale: '-20%',
      name: `Sản phẩm ${id}`,
      label: 'Xiaomi',
      priceOff: `${1_000_000 * id} đ`,
      priceOn: `${800_000 * id} đ`,
      title: `Mô tả sản phẩm ${id}`,
      describe: [
        `Tính năng nổi bật ${id}`,
        `Chi tiết sản phẩm ${id}`
      ]
    };
  })
};

export default labeldata;
